  console.log('NavbarLeft rendered with handleButtonClick:', handleButtonClick);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', position: 'absolute', left: '48px', top: '48px', gap:'10px'}}>
      <Button icon={<FaKey />} label="Truth & Dare" onClick={() => handleButtonClick('card1')} />
      <Button icon={<FaEye />} label="Positions" onClick={() => handleButtonClick('card2')} />
      <Button icon={<FaUser />} label="RÃ´le" onClick={() => handleButtonClick('card3')} />
    </div>
  );
};

export default NavbarLeft;
